settings.custom_css:
selector textPath {
    font-size: 1.5rem;
}

selector svg {   animation: ann-infinite-rotate 10s linear infinite;
}

@keyframes ann-infinite-rotate {
    0% {
        -webkit-transform: rotate(0deg);
        -o-transform: rotate(0deg);
        transform: rotate(0deg)
    }

    to {
        -webkit-transform: rotate(1turn);
        -o-transform: rotate(1turn);
        transform: rotate(1turn)
    }
}

selector .elementor-carousel-image {
    filter: grayscale(100%) invert(100%) brightness(50%);
    transition: filter .3s ease;
}

selector .swiper-slide:hover {
    .elementor-carousel-image {
    filter: grayscale(0%) invert(0%) brightness(50%);
}

selector .wp-container-core-columns-is-layout-1,
.wp-container-core-columns-is-layout-2 {
  margin: 0;
  gap: 1em;
}

@media screen and (max-width: 767px) {
  selector .wp-container-core-columns-is-layout-1,
  .wp-container-core-columns-is-layout-2 {
    gap: 0;
  }
}
